import axios from "axios";

export function getScreenList(){
    axios.get('http://192.168.22.99/edgeReceive/deviceList',{
      headers: {'Access-Control-Allow-Origin':'*'}
    })
    .then( (response) => {
      return response
    })
    .catch( (error) => console.log(error))
}
